import React,{ useState } from 'react'
import { LinkContainer } from "react-router-bootstrap";
import { Button, Navbar, Nav, NavDropdown } from 'react-bootstrap'
import { useDispatch, useSelector}  from 'react-redux'
import { logout } from '../actions/userAction'

const AdminDashboard = () => {
    const [active, setActive] = useState('')

    const dispatch = useDispatch()

    const userLogin = useSelector(state => state.userLogin)
    const { userInfo } = userLogin

    const logoutHandler = () =>{
        dispatch(logout())
    }

    const sidbarHandler = (e) =>{
        e.preventDefault()
        if(active === '')
            setActive('active')
        else
            setActive('')
    }


    return (
      <>
        <div className='wrap-sidebar'>
        <Navbar id='sidebar' className={`${active}`}>
          <Button 
            type='button' 
            variant='light'
            id="sidebarCollapse" 
            className="btn btn-primary" 
            onClick={sidbarHandler}
          ><i className="fa fa-bars"></i></Button>

          <Navbar.Brand href="/" className="brand-logo">B</Navbar.Brand>
          <Nav className="px-4 sidebar-navs">
            <Nav.Link href="/" className="px-4"><i className='fas fa-home'></i> Home</Nav.Link>
            <Nav.Link href="/bikes" className="px-4"><i className='fas fa-bicycle'></i> Bike Store</Nav.Link>
            <Nav.Link href="/contact" className="px-4"><i className='fas fa-phone'></i> Contact</Nav.Link>
          </Nav>
        </Navbar>
        </div>
    


        
      </>
    )
}

export default AdminDashboard
